import React from 'react';
import "./styles.scss";

//{img, title, date, desc, payload}
export class Launch extends React.Component{
    constructor(props){
        super(props);
        this.state={
            img: props.img,
            title: props.title,
            date: props.date,
            desc: props.desc,
            payload: props.payload
        }
    }

    render(){ 
        return(
            <div className="launch">
                <img src={this.state.img} alt="" className="launchImg"></img>
                <h2 className="launchTitle">{this.state.title}</h2>
                <h2 className="launchDate">{this.state.date}</h2>
                <p className="desc">{this.state.desc}</p>
                {/*payloads may need own component*/}
            </div>
        );
    }
}
